script: |
  super -f text -I q4344.spq | sort > q4344.out

inputs:
  - name: q4344.spq
    data: |
      SELECT DISTINCT COUNT ( * ) FROM tab1 (FORMAT parquet) WHERE NOT NULL IS NULL OR NOT col0 = + 90 * col0 * - 76 / + 84 * - + ( col1 );
  - name: tab1

outputs:
  - name: q4344.out
    data: |
      3
